import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (try clicking the cart icon/text)
    // Try to find the cart by text "Cart" inside a div
    const cartDiv = await page.waitForSelector('//div[contains(@class,"cart") and contains(normalize-space(),"Cart")]', { timeout: 5000 });
    await cartDiv.click();

    // Wait for the cart modal/dialog to appear (look for "Your cart" or a remove button)
    // Wait for either a "Remove" button or "Your cart is empty" text
    // Try to wait for a remove button in the cart modal
    await page.waitForTimeout(800); // allow modal animation

    // Try to find a remove button by its class and text
    let removeBtn = await page.$('//button[contains(@class,"remove-item") and (contains(text(),"Remove") or contains(.,"Remove"))]');
    let cartWasEmpty = false;

    if (!removeBtn) {
      // If not found, check if cart is empty
      const emptyCart = await page.$('//div[contains(@class,"empty-cart") and contains(text(),"empty")]');
      if (emptyCart) {
        cartWasEmpty = true;
      } else {
        // Wait a bit more and retry
        await page.waitForTimeout(1000);
        removeBtn = await page.$('//button[contains(@class,"remove-item") and (contains(text(),"Remove") or contains(.,"Remove"))]');
      }
    }

    // Take screenshot of cart before removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    let removedTitle = null;
    let cartCountBefore = null;
    let cartCountAfter = null;

    // Extract cart count before removal
    const cartCountSpan = await page.$('xpath=//div[contains(@class,"cart")]/span[contains(@class,"cart-count")]');
    if (cartCountSpan) {
      cartCountBefore = await cartCountSpan.textContent();
    }

    if (!cartWasEmpty && removeBtn) {
      // Extract the title of the item to be removed for verification
      const cartItemTitle = await removeBtn.evaluateHandle(node => {
        // Go up to .cart-item and find .cart-item-title
        let el = node.closest('.cart-item');
        if (el) {
          let titleEl = el.querySelector('.cart-item-title');
          return titleEl ? titleEl.textContent : null;
        }
        return null;
      });
      removedTitle = await cartItemTitle.jsonValue();

      // Click the remove button
      await removeBtn.click();

      // Wait for the item to disappear (cart-item with that title gone)
      await page.waitForTimeout(1000);

      // Take screenshot after removal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

      // Extract cart count after removal
      const cartCountSpanAfter = await page.$('xpath=//div[contains(@class,"cart")]/span[contains(@class,"cart-count")]');
      if (cartCountSpanAfter) {
        cartCountAfter = await cartCountSpanAfter.textContent();
      }

      // Check if empty cart message appears
      const emptyCartAfter = await page.$('//div[contains(@class,"empty-cart") and contains(text(),"empty")]');
      const cartIsEmpty = !!emptyCartAfter;

      return {
        success: true,
        action: `Removed item "${removedTitle}" from cart`,
        extractedData: {
          removedTitle,
          cartCountBefore,
          cartCountAfter,
          cartIsEmpty
        },
        screenshots,
        error: null
      };
    } else if (cartWasEmpty) {
      return {
        success: true,
        action: "Cart was already empty, no item to remove",
        extractedData: {
          cartCountBefore,
          cartCountAfter: cartCountBefore,
          cartIsEmpty: true
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: false,
        action: "Failed to find remove button or cart state",
        extractedData: {},
        screenshots,
        error: "No remove button found and cart not empty"
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
